import React, { useState } from "react";
import Dashboard from "../Details/Dashboard";
import MainContainer from "../Details/MainContainer";

const Main: React.FC = () => {
  const [selected, setSelected] = useState<string>("");

  return (
    <div>
      {/* Передаем setSelected как коллбэк в Dashboard */}
      <Dashboard onSelectedChange={setSelected} />
      <MainContainer selected={selected} />
    </div>
  );
};

export default Main;
